webpackJsonp([0x734a400e0862],{4249:function(e,n){e.exports={data:{markdownRemark:{html:'<p>前回の某泡を消すパズルゲームのWeb体験版に次いで、今度は某レトロなSTGリメイク版のティザ作る仕事をやってます。どっからひょんなお仕事が飛んでくるもんか分かったもんじゃないなあ。本当に<a href="/!/thC/">夢終劇</a>作ってよかったと思った。</p>\n<p>どうでもいいが今更になって夢終劇とメルブラの関係が分かった。今まで散々言われ続けてその度に自分の頭の中でハテナマークが踊り続けていたんだが、それが今更電球マークになった。そーだったのかー。</p>\n<h2>Flex SDKメモ</h2>\n<p>Flex SDK3.2で実装されたVectorクラスなんだが、どうもunshiftが機能していないっぽい。前後に<code>trace(vec.length);</code>仕掛けても数値が変化せず。ネットを一通り探しても見当たらない……と言うかFlash10対応！の影に隠れて、Vectorの資料が少ない。もしかして、バグつついちまったかな？ちょい土日で再度調べてみるか。</p>\n<p>あとUIComponentクラス(Canvasの基底クラス)をnewした途端にFlash swfのサイズが26KB→440KBに膨れ上がった。弾幕風の人(mkm氏)も言っていたが、C++でBoostを使った途端EXEサイズもBoostされた時以来の衝撃を覚えた。あんた鬼ですか。</p>\n<h2>1/17 20:20追記</h2>\n<p>下記のようなごく単純なコードを書いてみたらArrayは普通に値が増えるのにVectorは1以上増えない。まじでバグつついちまったかも？</p>\n<h2>ソース</h2>\n<p><code>package{ import flash.display.Sprite; public class test extends Sprite{ public function test(){ var vecA:Vector.&#x3C;int> = new Vector.&#x3C;int>(); var vecB:Vector.&#x3C;Hoge> = new Vector.&#x3C;Hoge>(); var arr:Array = []; var i:int; trace(arr.length, vecA.length, vecB.length); for(i = 0; i &#x3C; 3; i++){ vecA.unshift(i); vecB.unshift(new Hoge(i)); arr.unshift(new Hoge(i)); } trace(arr.length, vecA.length, vecB.length); trace("\\----------"); for(i = 0; i &#x3C; 3; i++){ trace(arr.pop(), vecA.pop(), vecB.pop()); } } } } class Hoge{ public var m_n:int; public function Hoge(n:int){ m_n = n; } public function toString():String{ return m_n.toString(); } }</code></p>\n<h2>出力</h2>\n<p>0 0 0\n3 3 <strong>1</strong>\n----------\n0 0 2\n1 1 <strong>undefined</strong>\n2 2 <strong>undefined</strong>\n[SWF] C:\\Documents and Settings\\mikuh\\My Documents\\Flex Builder 3\\test\\bin-debug\\test.swf - 1,776 バイト (圧縮後)</p>\n<h2>1/18 19:50追記</h2>\n<p>結局<a href="http://bugs.adobe.com/jira/browse/ASC-3620">FlexSDK側のバグだったようです</a>。しかしもう対応済みとのことだが、最新版のFlexSDK突っ込んでも直ってない様子。とりあえず当面はコーディングが回りくどくなるが、spliceで代用しておくか。</p>',frontmatter:{cover:null,date:"2009-01-16T22:57:00+09:00",strDate:"2009/1/16",title:"近況報告"}}},pathContext:{path:"/ja/blog/2009/01/16-近況報告-2/",langKey:"ja"}}}});
